import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // The sort filter is not on the main page. We need to navigate to a category first.
    // We will click on the "Electronics" category card to reveal the sort options.
    const electronicsCategoryCard = page.locator('.category-card', { hasText: 'Electronics' });
    await electronicsCategoryCard.waitFor({ state: 'visible', timeout: 5000 });
    await electronicsCategoryCard.click();

    // Wait for the page to update and the sort control to appear
    const sortSelect = page.locator('#sortSelect');
    await sortSelect.waitFor({ state: 'visible', timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_category_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_category_view.png'));

    // Apply the "Price: High to Low" sort filter
    await sortSelect.selectOption({ value: 'price-high' });

    // Take a screenshot after applying the filter
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_price_sorted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_price_sorted.png'));

    // Extract the selected value to verify the action
    const selectedValue = await sortSelect.inputValue();

    if (selectedValue !== 'price-high') {
      throw new Error('Price sort filter was not applied correctly. Expected "price-high", got "' + selectedValue + '".');
    }

    return {
      success: true,
      action: "Applied price sort filter (High to Low)",
      extractedData: {
        selectedValue: selectedValue
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // Take a screenshot on error
    const errorScreenshots = [];
    try {
      const errorScreenshotPath = path.join(screenshotsDir, 'error_screenshot.png');
      await page.screenshot({ path: errorScreenshotPath });
      errorScreenshots.push(errorScreenshotPath);
    } catch (e) {
      // Ignore if screenshot fails
    }

    return {
      success: false,
      action: "Failed to apply price sort filter",
      extractedData: {},
      screenshots: errorScreenshots,
      error: error.message
    };
  }
}
